import React from 'react';
import NavBar from './NavBar';
import coverphoto from '../../public/perry-grone-lbLgFFlADrY-unsplash.jpg'

const Home = () => {
   return (
      <div>
         <NavBar />
         <img
            src={coverphoto}
            alt="group of people huddling"
         />
         <h1>Play It Forward</h1>
         <h2>Upcoming Events</h2>
      </div>
   );
};

export default Home;
